import React from 'react';
import { NavLink, Route } from 'react-router-dom';

const Nav = () => {
    return (
        <nav className="main-nav">
            <ul>
                <li><NavLink to='/food'>Food</NavLink></li>
                <li><NavLink to='/beaches'>Beaches</NavLink></li>
                <li><NavLink to='/sunset'>Sunset</NavLink></li>
            </ul>
        </nav>  
    );
}

export default Nav;
